from emgapi.models import SuperStudy, Study, SuperStudyStudy, SuperStudyGenomeCatalogue, GenomeCatalogue
ss = SuperStudy.objects.create(
    title='Excellent Adventure',
    url_slug='excellent',
    description='The **Excellent Adventure** project travelled through [space and time]('
                'https://www.imdb.com/title/tt0096928/) to collect microbiome samples.',
    logo='data:image/svg+xml;base64,'
)
SuperStudyStudy.objects.create(study=Study.objects.first(), super_study=ss)
SuperStudyGenomeCatalogue.objects.create(genome_catalogue=GenomeCatalogue.objects.first(), super_study=ss)